import React, { Component } from 'react';
import Container from 'react-bootstrap/Container';

class MenuListing extends Component {
    render() {
        return (
            <React.Fragment>
                <Container>
                    <Row>
                        <Col>Item 1</Col>
                        <Col>Item 2</Col>
                    </Row>
                    <Row>
                        <Col>Item 3</Col>
                        <Col>Item 4</Col>
                    </Row>

                </Container>

            </React.Fragment>
        );
            
        
    }
}

export default MenuListing;
